    if((b*b+c*c<a*a)||(a*a+c*c<b*b)||(a*a+b*b<c*c))printf("Obtuse Triangle");
    else
    {
        if((b*b+c*c>a*a)||(a*a+c*c>b*b)||(a*a+b*b>c*c))printf("Acute Triangle");
