#include <stdlib.h>

int main()
{
    int *A;int n;
    scanf("%d",&n);
    A=(int*)malloc(n*sizeof(int));//allocating array dynamically
    for(int i=0;i<n;i++)
        scanf("%d ",&A[i]);
    int top=0;int bot=n-1;int mid=(top+bot)/2;
    while(top<bot)
    {
        if(A[mid]==mid)
            break;
        if(A[mid]>mid)
        {
            bot=mid-1;
            mid=(top+bot)/2;
        }
        if(A[mid]<mid)
        {
            top=mid+1;
            mid=(top+bot)/2;
        }
    }
    if(A[mid]==mid)
        printf("%d",1);
    else
        printf("%d",-1);
    return 0;
}

