void rowmax(int a[100][100],int p,int q)//func. to find maximum row sum
{
   int r=0,rsum[p],i,j,k, prev, l = 0;
   for(i=0;i<p;i++)
   {
       r = 0;
       for(j=0;j<q;j++)
       {
           r += a[i][j];
       }
       if((i == 0))
       {
           rsum[i] = i;
           prev = r;
       }
      if(r > prev){
          l = 0;
          rsum[l++] = i;
          prev = r;
      }
      if(r == prev){
          rsum[l++] = i;
      }
   }
   for(k=0;k<l;k++)
   {
       printf("%d ",rsum[k]);
   }



}
