correctedCode:
#include<stdio.h>

int main()
{
    int a,b,c,p,q,r;
    scanf("%d%d%d",&a,&b,&c);
    if ((a+b)<c ||(a+c)<b ||(b+c)<a ){
        printf("Invalid Triangle");return 0;
    }
    p=a*a+b*b-c*c;
    q=a*a+c*c-b*b ;
    r=c*c+b*b-a*a;

    if((p>0 ||q>0 )||r>0){
        printf("Obtuse Tringle\n");
    }
    else{
        if (p*q*r==0){
        printf("Right Triangle\n");
    }
    else if ((p<0 && q<0) && r<0){
        printf("acute triangle\n");
    }}
    return 0;
}

